        methods: {
            init(model) {
                let camera_x = this.camera_x;
                let camera_y = this.camera_y;
                let camera_z = this.camera_z;

                let look_x = this.look_x;
                let look_y = this.look_y;
                let look_z = this.look_z;

                let X = new Float32Array(this.X);
                let Y = new Float32Array(this.Y);
                let Z = new Float32Array(this.Z);

                let R = new Float32Array(this.R);
                let G = new Float32Array(this.G);
                let B = new Float32Array(this.B);

                let S_x = this.S_x;
                let S_y = this.S_y;
                let S_z = this.S_z;

                let n_voxels = this.n_voxels;
                let axis_size = this.axis_size;

                // this.container = document.getElementById( 'container' );

                this.scene = new THREE.Scene();

                this.camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000 );
                this.camera.position.x = camera_x;
                this.camera.position.y = camera_y;
                this.camera.position.z = camera_z;
                this.camera.up = new THREE.Vector3( 0, 0, 1 );

                if (axis_size > 0) {
                    let axisHelper = new THREE.AxisHelper( axis_size );
                    this.scene.add( axisHelper );
                }

                let geometry = new THREE.BoxGeometry( S_x, S_z, S_y );

                for ( let i = 0; i < n_voxels; i ++ ) {{
                    let mesh = new THREE.Mesh( geometry, new THREE.MeshBasicMaterial() );
                    mesh.material.color.setRGB(R[i], G[i], B[i]);
                    mesh.position.x = X[i];
                    mesh.position.y = Y[i];
                    mesh.position.z = Z[i];
                    this.scene.add(mesh);
                }}

                // this.renderer = new THREE.WebGLRenderer({antialias: false});
                this.renderer = new THREE.WebGLRenderer({canvas: this.$refs.threejs});
                this.renderer.setPixelRatio( window.devicePixelRatio );
                //this.renderer.setSize( window.innerWidth, window.innerHeight );
                this.renderer.setSize(800, 500 );

                this.controls = new OrbitControls( this.camera, this.renderer.domElement );
                // this.controls.target.copy( new THREE.Vector3(look_x, look_y, look_z) );
                this.camera.lookAt( new THREE.Vector3(look_x, look_y, look_z));
            },

            animate() {
                // this.render();
                requestAnimationFrame( this.animate );
                this.controls.update();
                this.renderer.render( this.scene, this.camera );
            },

            render() {

                requestAnimationFrame( this.animate );
                this.renderer.render( this.scene, this.camera );
            },

            set_models(models) {
                this.models = models;
            },
